const Delivery = () => {
  
    var today = new Date();
  var date =
    today.getDate() +
    "/" +
    (today.getMonth().slice(-2) + 1) +
    "/" +
    today.getFullYear().toString();
  console.log(date);

  return <div></div>;
};

export default Delivery;
